import torch
from diffusers import StableDiffusionInpaintPipeline
from PIL import Image
import numpy as np
import matplotlib.pyplot as plt

def load_quantized_model(model_path):
    """
    Loads a quantized StableDiffusionInpaintPipeline model.

    Args:
        model_path (str): Path to the model, either a Hugging Face Hub identifier
                          or a local directory.

    Returns:
        StableDiffusionInpaintPipeline: The loaded model.
    """
    try:
        model = StableDiffusionInpaintPipeline.from_pretrained(
            model_path,
            torch_dtype=torch.bfloat16
        )
        model = model.to("cuda" if torch.cuda.is_available() else "cpu")
        print("Model loaded successfully!")
        return model
    except Exception as e:
        print(f"Error loading model: {e}")
        raise

def generate_mask(img):
    """
    Generates a placeholder mask. Replace this with actual logic if available.

    Args:
        img (PIL.Image.Image): The input image.

    Returns:
        PIL.Image.Image: A binary mask.
    """
    # Placeholder logic for a mask: creates a centered square mask
    width, height = img.size
    mask = np.zeros((height, width), dtype=np.uint8)
    center_x, center_y = width // 2, height // 2
    square_size = min(width, height) // 4
    mask[
        center_y - square_size:center_y + square_size,
        center_x - square_size:center_x + square_size
    ] = 255  # White square mask
    return Image.fromarray(mask)

def replace_object(model, img, mask, prompt):
    """
    Replaces an object in the image using the inpainting model.

    Args:
        model (StableDiffusionInpaintPipeline): The inpainting model.
        img (PIL.Image.Image): The original image.
        mask (PIL.Image.Image): The binary mask image.
        prompt (str): The prompt for inpainting.

    Returns:
        PIL.Image.Image: The inpainted image.
    """
    try:
        img_tensor = model(
            prompt=prompt,
            image=img,
            mask_image=mask
        ).images[0]
        return img_tensor
    except Exception as e:
        print(f"Error during inpainting: {e}")
        raise

def display_images(original_img, mask_img, result_img):
    """
    Displays the original image, mask, and result image side-by-side.

    Args:
        original_img (PIL.Image.Image): The original input image.
        mask_img (PIL.Image.Image): The generated mask image.
        result_img (PIL.Image.Image): The result after inpainting.
    """
    plt.figure(figsize=(15, 5))

    plt.subplot(1, 3, 1)
    plt.title("Original Image")
    plt.imshow(original_img)
    plt.axis("off")

    plt.subplot(1, 3, 2)
    plt.title("Generated Mask")
    plt.imshow(mask_img, cmap="gray")
    plt.axis("off")

    plt.subplot(1, 3, 3)
    plt.title("Result Image")
    plt.imshow(result_img)
    plt.axis("off")

    plt.show()

def main():
    # Load the quantized model
    model_path = "runwayml/stable-diffusion-inpainting"  # Using default Hugging Face model for testing
    model = load_quantized_model(model_path)

    # Load your image (this may be replaced with url of any desired image file )
    input_image_path = '/content/Look 1 .png'  # Update this with your image path
    try:
        original_img = Image.open(input_image_path).convert("RGB")
    except FileNotFoundError:
        print(f"Image file not found: {input_image_path}")
        return

    # Define your prompt for object replacement
    prompt = "A new little white bag"  # prompt for the object replacement in the image

    # Generate mask
    mask_img = generate_mask(original_img)

    # Replace the object in the original image using the generated mask
    try:
        result_img = replace_object(model, original_img, mask_img, prompt)
    except Exception as e:
        print(f"Error replacing object: {e}")
        return

    # Display results
    display_images(original_img, mask_img, result_img)

if __name__ == "__main__":
    main()

