SAM_CHECKPOINT_PATH = "/content/sam_vit_h_4b8939.pth"

# Use SD3.5 (Stable Diffusion Inpainting Model)
INPAINT_MODEL = "stabilityai/stable-diffusion-2-inpainting"

# Load the SAM model for segmentation
def load_sam_model(checkpoint_path, model_type="vit_h"):
    sam = sam_model_registry[model_type](checkpoint=checkpoint_path).to(DEVICE)
    mask_generator = SamAutomaticMaskGenerator(sam)
    return mask_generator

# Load the inpainting model (quantized)
def load_quantized_inpainting_model(model_path):
    inpainting_pipeline = StableDiffusionInpaintPipeline.from_pretrained(model_path, torch_dtype=torch.float16).to(DEVICE)
    return inpainting_pipeline

# Initialize models
mask_generator = load_sam_model(SAM_CHECKPOINT_PATH)
inpainting_model = load_quantized_inpainting_model(INPAINT_MODEL)

# Function to generate a mask automatically
def generate_auto_mask(image_path, mask_generator):
    """
    Automatically generates a mask for the input image.

    Args:
        image_path (str): Path to the input image.
        mask_generator: SAM Mask Generator.

    Returns:
        original_image: PIL.Image of the original image.
        mask_image: PIL.Image of the binary mask.
    """
    # Load the image
    image_path = ('/content/Contemporary Solid Wood Side Chair Metallic Finish Indoor-Outdoor Windsor Chair Walnut-4 Piece Set.jpg')
    image = Image.open(image_path).convert("RGB")
    image_array = np.array(image)

    # Generate masks using SAM
    masks = mask_generator.generate(image_array)

    # Select the first mask for simplicity
    mask = masks[0]["segmentation"]

    # Convert the mask to a PIL image
    mask_image = Image.fromarray((mask * 255).astype(np.uint8))

    return image, mask_image

# Function to replace an object in the image
def replace_object(inpainting_model, original_image, mask_image, prompt):
    """
    Replaces an object in the input image based on the provided prompt.

    Args:
        inpainting_model: Pre-trained inpainting model.
        original_image: PIL.Image of the original image.
        mask_image: PIL.Image of the binary mask.
        prompt (str): Text prompt for object replacement.

    Returns:
        result_image: PIL.Image of the inpainted result.
    """
    result = inpainting_model(
        prompt=prompt,
        image=original_image,
        mask_image=mask_image,
    )
    return result.images[0]

# Function to display and save results
def display_results(original_image, mask_image, result_image, save_path="/content/output"):
    """
    Displays and save the original image, mask, and result.

    Args:
        original_image: Original input image (PIL.Image).
        mask_image: Generated mask (PIL.Image).
        result_image: Inpainted result image (PIL.Image).
        save_path (str): Directory to save the images.

    Returns:
        None
    """
    import os
    os.makedirs(save_path, exist_ok=True)

    # Save images
    original_image.save(f"{save_path}/original_image.png")
    mask_image.save(f"{save_path}/mask_image.png")
    result_image.save(f"{save_path}/result_image.png")

    # Display images
    plt.figure(figsize=(15, 5))

    plt.subplot(1, 3, 1)
    plt.title("Original Image")
    plt.imshow(original_image)
    plt.axis("off")

    plt.subplot(1, 3, 2)
    plt.title("Generated Mask")
    plt.imshow(mask_image, cmap="gray")
    plt.axis("off")

    plt.subplot(1, 3, 3)
    plt.title("Inpainted Image")
    plt.imshow(result_image)
    plt.axis("off")

    plt.show()

    print(f"Results saved in '{save_path}' directory.")

# Main pipeline function
def main_pipeline(image_path, sam_checkpoint, model_path, inpaint_prompt):
    """
    Run the entire object replacement pipeline.

    Args:
        image_path (str): Path to the input image.
        sam_checkpoint (str): Path to the SAM checkpoint.
        model_path (str): Path to the inpainting model.
        inpaint_prompt (str): Prompt for inpainting.

    Returns:
        None
    """
    # Generate mask
    original_image, mask_image = generate_auto_mask(image_path, mask_generator)

    # Replaceing object in image
    result_image = replace_object(inpainting_model, original_image, mask_image, inpaint_prompt)

    # Display results
    display_results(original_image, mask_image, result_image)

